    false,nt"url": null,nt"notes": "This annual narrative report for Alligator
    River and Pea Island NWRs outlines Refuge accomplishments during 1997 and 1998.
    The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the management plan and compliance with environmental and cultural resource mandates.
    Refuge administration is outlined; information about personnel, volunteer programs,
    funding, and safety is given. Habitat management is also covered; subjects include
    wetlands, forests, croplands, fire management, and pest control. The wildlife section
    of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, raptors, game mammals, marine mammals, animal control,
    and marking and banding. The public uses of the Refuge described in this report
    include outdoor classrooms, interpretive programs, hunting, fishing, trapping, wildlife
    observation, and law enforcement. The equipment and facilities section of the report
    provides information about new construction, rehabilitation, major maintenance,
    equipment replacement, and communication systems. Items of interest are provided
    at the end.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
